import React from 'react'

export default function Gallery({rects, handleRemoveRect}) {

    return (
        <div>
            <h1>Galeria</h1>
            {rects && <ul>
                {rects.map((rect, id) =>
                    <div key={id}>
                        <li>{rect}</li>
                        <button onClick={({id}) => handleRemoveRect({id})}>Remove</button>
                    </div>)}
            </ul>}
        </div>
    )
}
